import React from "react";
import { bankOne, bankTwo } from "./banks";

function Clavier() {
  return (
    <div className="display">
      {bankOne.map((note) => (
        <p key="note.keyTrigger" id="note.keyTrigger" className="drum-pad">
          {note.keyTrigger}
          audio
        </p>
      ))}
    </div>
  );
}

export default Clavier;
